import{_ as t,c as o,o as a,a3 as r}from"./chunks/framework.BtFBCm54.js";const g=JSON.parse('{"title":"Neuko Community","description":"","frontmatter":{},"headers":[],"relativePath":"community/overview.md","filePath":"community/overview.md"}'),i={name:"community/overview.md"};function s(n,e,l,h,u,m){return a(),o("div",null,[...e[0]||(e[0]=[r('<h1 id="neuko-community" tabindex="-1">Neuko Community <a class="header-anchor" href="#neuko-community" aria-label="Permalink to &quot;Neuko Community&quot;">​</a></h1><blockquote><p><strong>High conviction, collaborative puzzle-solving, and a strong cultural identity.</strong></p></blockquote><p>The Neuko community (&quot;Operatives&quot;) is characterized by organic growth and deep engagement. Unlike typical &quot;wen mint&quot; discords, this community formed around solving puzzles, decoding lore, and a shared social experiment.</p><h2 id="culture-values" tabindex="-1">Culture &amp; Values <a class="header-anchor" href="#culture-values" aria-label="Permalink to &quot;Culture &amp; Values&quot;">​</a></h2><h3 id="core-philosophy" tabindex="-1">Core Philosophy <a class="header-anchor" href="#core-philosophy" aria-label="Permalink to &quot;Core Philosophy&quot;">​</a></h3><ul><li><strong>Engagement Over Extraction</strong>: Rewards those who contribute, not just extract value.</li><li><strong>Collaboration Over Competition</strong>: Puzzles are solved together in public threads.</li><li><strong>Diamond Hands</strong>: Extremely low sell pressure (2-3% listed) despite a down market.</li></ul><h3 id="identity-markers" tabindex="-1">Identity Markers <a class="header-anchor" href="#identity-markers" aria-label="Permalink to &quot;Identity Markers&quot;">​</a></h3><ul><li><strong>Red Hoodie PFP</strong>: Members adopt the &quot;G*Boy&quot; red hoodie as a visual tribe signal.</li><li><strong>Operative Designations</strong>: Many use the format <code>OPERATIVE {Designation:; #:XXX}</code> in their bio.</li></ul><h3 id="memes-rituals" tabindex="-1">Memes &amp; Rituals <a class="header-anchor" href="#memes-rituals" aria-label="Permalink to &quot;Memes &amp; Rituals&quot;">​</a></h3><ul><li><strong>HEMLET</strong>: Originating from a typo (&quot;The helmet stays on&quot; → &quot;HEMLET&quot;), this became an official brand element referenced by the team (&quot;HEMLET CORP&quot;).</li><li><strong>Ribbit</strong>: A community meme (&quot;Frog Gummies&quot;) that was also acknowledged in official videos.</li><li><strong>Owl Hoots</strong>: Audio shoutouts to community member @satoshi_owl in official transmissions.</li></ul><h2 id="the-snake-badge-experiment" tabindex="-1">The &quot;Snake Badge&quot; Experiment <a class="header-anchor" href="#the-snake-badge-experiment" aria-label="Permalink to &quot;The &quot;Snake Badge&quot; Experiment&quot;">​</a></h2><p>Phase 3 (Snake Badges) was a social experiment in <strong>trust and distribution</strong>.</p><ul><li><strong>The Setup</strong>: The team gave Snake badges to existing holders with zero instructions. They could Sell, Hold, or Gift.</li><li><strong>The Result</strong>: The vast majority chose to <strong>gift</strong> them to active community members, effectively decentralizing the onboarding process.</li><li><strong>The Lesson</strong>: This proved the community valued long-term growth and &quot;skin in the game&quot; over quick profits.</li></ul><h2 id="growth-stats-nov-2025" tabindex="-1">Growth Stats (Nov 2025) <a class="header-anchor" href="#growth-stats-nov-2025" aria-label="Permalink to &quot;Growth Stats (Nov 2025)&quot;">​</a></h2><ul><li><strong>Followers</strong>: 0 → 13,000+ in ~4 weeks (100% organic).</li><li><strong>Mindshare</strong>: ~0.25% (higher than many established blue chips).</li><li><strong>Holders</strong>: 1,100+ unique badge holders.</li><li><strong>Listings</strong>: ❤️% listed on marketplaces.</li></ul><h2 id="key-operatives" tabindex="-1">Key Operatives <a class="header-anchor" href="#key-operatives" aria-label="Permalink to &quot;Key Operatives&quot;">​</a></h2><p>The community is built by its members. Here are some key figures to follow:</p><h3 id="puzzle-solvers" tabindex="-1">Puzzle Solvers <a class="header-anchor" href="#puzzle-solvers" aria-label="Permalink to &quot;Puzzle Solvers&quot;">​</a></h3><ul><li><strong><a href="https://x.com/thrax_nft" target="_blank" rel="noreferrer">@thrax_nft</a></strong> (&quot;The Detective&quot;): Discovered console logs and website secrets.</li><li><strong><a href="https://x.com/0xstateoftheart" target="_blank" rel="noreferrer">@0xstateoftheart</a></strong>: Audio analysis pioneer (spectrograms).</li><li><strong><a href="https://x.com/eleven88eth" target="_blank" rel="noreferrer">@eleven88eth</a></strong>: Complex puzzle coordination.</li></ul><h3 id="community-voices" tabindex="-1">Community Voices <a class="header-anchor" href="#community-voices" aria-label="Permalink to &quot;Community Voices&quot;">​</a></h3><ul><li><strong><a href="https://x.com/satoshi_owl" target="_blank" rel="noreferrer">@satoshi_owl</a></strong>: Writes the &quot;DEBRIEF&quot; series documenting lore.</li><li><strong><a href="https://x.com/Sinsonx" target="_blank" rel="noreferrer">@Sinsonx</a></strong>: Comprehensive recaps and onboarding threads.</li><li><strong><a href="https://x.com/TheKeeperOfX" target="_blank" rel="noreferrer">@TheKeeperOfX</a></strong>: &quot;The Keeper&quot; – onboarding and HEMLET meme originator.</li></ul><h2 id="ama-highlights-nov-2025" tabindex="-1">AMA Highlights (Nov 2025) <a class="header-anchor" href="#ama-highlights-nov-2025" aria-label="Permalink to &quot;AMA Highlights (Nov 2025)&quot;">​</a></h2><ul><li><strong>Community First</strong>: The team emphasized they are building a &quot;social layer&quot; first, product second.</li><li><strong>Consistency</strong>: &quot;Showing up&quot; is the most valuable currency in this ecosystem.</li><li><strong>No Roadmap</strong>: The mystery <em>is</em> the product.</li></ul><h2 id="related-pages" tabindex="-1">Related Pages <a class="header-anchor" href="#related-pages" aria-label="Permalink to &quot;Related Pages&quot;">​</a></h2><ul><li><a href="./../badges">Badges</a></li><li><a href="./../lore">Lore</a></li><li><a href="./../transmissions/overview">Transmissions</a></li></ul>',25)])])}const c=t(i,[["render",s]]);export{g as __pageData,c as default};
